using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct PoolableTagComponentResolver : IResolver<PoolableTagComponent>, IResolver<PoolableTagComponentResolver,PoolableTagComponent>, IData	{		public PoolableTagComponentResolver In(ref PoolableTagComponent poolabletagcomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetPoolableTagComponent();			Out(ref local);		}		public void Out(ref PoolableTagComponent poolabletagcomponent)		{		}	}}